mode: cd
namespace: pathoplexus

runtime_config_json: |-
  {
      "backendUrl": "http://localhost:8079",
      "lapisUrl": "http://localhost:8080"
  }

config_json: |-
  {
      "schema": {
          "instanceName": "sars_cov-2_open",
          "metadata": [
