              },
              {
                  "name": "date",
                  "type": "date"
              },
              {
                  "name": "dateSubmitted",
                  "type": "date"
              },
              {
                  "name": "samplingStrategy",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "region",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "country",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "division",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "location",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "regionExposure",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "countryExposure",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "divisionExposure",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "host",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "age",
                  "type": "integer",
                  "autocomplete": true
              },
              {
                  "name": "sex",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "pango_lineage",
                  "type": "pango_lineage",
                  "autocomplete": true
              },
              {
                  "name": "nextcladePangoLineage",
                  "type": "pango_lineage",
                  "autocomplete": true
              },
              {
                  "name": "nextstrainClade",
                  "type": "string",
                  "autocomplete": true
              },
              {
                  "name": "originatingLab",
                  "type": "string"
              },
              {
                  "name": "submittingLab",
                  "type": "string"
              },
              {
                  "name": "authors",
                  "type": "string"
              }
          ],
          "tableColumns": ["country", "division", "date", "pango_lineage"],
          "primaryKey": "accession"
      }
  }

database_config_yaml: |-
  schema:
    instanceName: PathoplexusTest
    opennessLevel: OPEN
    metadata:
      - name: accession
        type: string
      - name: date
        type: date
      - name: region
        type: string
        generateIndex: true
      - name: country
        type: string
        generateIndex: true
      - name: pango_lineage
        type: pango_lineage
      - name: division
        type: string
        generateIndex: true
      - name: age
        type: int
      - name: qc_value
        type: float
      - name: insertions
        type: insertion
      - name: aaInsertions
        type: aaInsertion
    features:
      - name: sarsCoV2VariantQuery
    primaryKey: accession
    dateToSortBy: date
    partitionBy: pango_lineage
